description_uz:
Fasad tozalagich
- sirtni tuz bilan ifloslanishdan samarali tozalaydi (gullash va chiziqlar);
- suvda eriydigan va suvda erimaydigan karbonat, sulfat va ohak turlarini ifloslantiruvchi moddalarni yo'q qiladi;
- quritilganda iz va chiziqlar qoldirmaydi;
- har qanday qoplamali sirtni keyingi ishlov berishga to'sqinlik qilmaydi.

description_ru:
Очиститель фасада
- эффективно очищает поверхность от солевых загрязнений (налета и полос);
- удаляет водорастворимые и нерастворимые в воде карбонатные, сульфатные и известковые загрязнители;
- не оставляет следов и полос при высыхании;
- не препятствует дальнейшей обработке любой облицовочной поверхности.

description_uz:
Boshqa har qanday elektr asbob bilan ishlashda bo'lgani kabi, burchak maydalagich bilan ishlashni boshlashdan oldin ko'rsatmalarni o'qib chiqishingiz kerak. Xavfsizlik qoidalarini e'tiborsiz qoldirish o'limga olib kelishi yoki sog'liqqa jiddiy zarar etkazishi mumkin. Uhm bilan ishlashda asosiy xavfli omillar:

Elektr toki urishi ehtimoli;
Qayta ishlangan materialning qismlari yoki ishchi doiraning qismlari, agar u yo'q qilingan bo'lsa, maydalagich doirasi ostidan uchib chiqib, jarohat olish ehtimoli;
Uhm ishi paytida chiqarilgan changning nafas olish tizimiga, ko'rish qobiliyatiga, teriga salbiy ta'siri.

description_ru:
Как и при работе с любым другим электроинструментом, перед началом работы с угловой шлифовальной машиной следует ознакомиться с инструкцией. Пренебрежение нормами техники безопасности может привести к смерти или нанести существенный ущерб здоровью. Основными опасными факторами при работе с УШМ являются:

Возможность поражения электрическим током;
Возможность получения ранения вылетающими из-под круга болгарки частями обрабатываемого материала либо частями рабочего круга в случае его разрушения;
Негативное воздействие пыли, выделяющейся при работе УШМ, на органы дыхания, зрения, кожу.

